    // src/components/contacts.js
    import React from 'react'

    const Contacts = ({ contacts }) => {
      const element = fetch("https://localhost:44358/api/UserInformations/45505")
      .then((response) => response.json())
      .then((data) => console.log('Here is my data returned:', data.accountNumber));

      return (
        <div>
          {this.state.contacts.map(({firstName, accountBalance}, i) => (
            <div key={i} className="card">
            <div>
                <h6 class="card-title">{firstName.map((firstName, j) => <p key = {j}>{firstName}</p>)}</h6>

            </div>
            </div>
          ))}
        </div>
      )
    };

    export default Contacts;
